import React, { Component } from 'react'
import { Col } from 'react-bootstrap'

export default class ListCategories extends Component {
  render() {
    return (
      <div>
        <Col md={2} mt="3">
        <h4>
            <strong>Daftar kategori</strong>
        </h4>
        <hr />
        </Col>
      </div>
    )
  }
}
